■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ブリーデン ネックライト BNL-02 BREADEN NOT ONLY NECK LIGHT [BNL-02] / ヘッドライト / ヘッドランプ / 照明 / 夜釣り / LEDライト<br /><br />ジェスチャーモードに設定するとスイッチ操作をすることなく、手を振りかざすだけで便利にON、OFF切替え。従来の赤外線センサーを搭載したライトは、ネックライトとして使用した際に釣りの動作で反応してしまうという誤動作が問題でした。この誤動作が出来る限り少なくなるように、センサー反応距離の最適化を行っています。<br /><br />最大220ルーメンと非常に明るい白色LEDと高輝度赤色LEDを搭載しています。<br />白色LEDはHigh/Mid/Low/SOSと４つのモード、赤色LEDはHigh/Flashと２つのモードがあり、合計６つのモードから状況に合わせて選択できます。<br /><br />ディフューザーをスライドし、スポット光、拡散光を切り替えられます。<br /><br />しっかりと遠くまで状況を確認したい場合はスポット光へ、広範囲を見渡したい場合は拡散光へと切り替えることが可能です。<br /><br />ネックライト時、ヘッドライト時ともに45°の角度調整が可能で、手元、足元、目線にもフォーカスします。<br /><br />キャップやアウターウェアを装着した状態でも、簡単に首に装着することが可能。また適度に伸縮する素材のベルトを採用しているため、ネックライトとしてだけではなくヘッドライトとして使用することも可能です。<br /><br />リチウムポリマー充電池を搭載し、USBケーブルによる充電が可能です。充電式ですので、電池を購入する手間やコストが大幅カットでき快適な釣行が可能。移動中に車内でケーブルを接続し充電することもできます。<br /><br />電池ボックスには、安全のための後部認識灯を搭載しています。<br /><br />■発売年：2016年</font></td></tr></table><STYLE type="text/css">
